function Credantials({ info, setinfo }) {
    return (
      <div className="other-info-container">
        <input
          type="text"
          placeholder="Password"
          value={info.password_hash}
          onChange={(e) => {
            setinfo({ ...info,password_hash: e.target.value });
          }}
        />
      </div>
    );
  }
  
  export default Credantials;
